    process = subprocess.Popen(
        ["mapred", "minicluster", "-format", "-jhsport", "8900", "-nnhttpport", "8901", "-nnport", "8902", "-rmport", "8903"],
        stdout=stdout_file,
        stderr=stderr_file
    )


